package com.sugon.humanface_opencv.domain.entity;import lombok.Getter;import lombok.Setter;import javax.persistence.*;/** * Description: * Author     : Dawn.Ji * Date       : Created in 17:12 2018/11/7 */@Entity@Getter@Setter@Table(name = "t_face_compare_log")public class TFaceCompareLog {    @Id    private String id;    private String compareTime;    private String compareIdNum;    private String compareScore;    @Lob    @Basic    @Column(name = "compare_outimage",columnDefinition = "mediumblob",nullable = false)    private byte[] compareOutimage;    private String costTime;}